import React from 'react';
import { VictoryChart, VictoryGroup, VictoryTooltip, VictoryLine, VictoryScatter } from 'victory';

const data = [
  { x: 0, y: 0 },
  { x: 1, y: 0 },
  { x: 2, y: 0 },
  { x: 2, y: 1 },
  { x: 2, y: 2 },
  { x: 2, y: 3 },
  { x: 1, y: 3 }
];


const PlotRoute = () => {
  return(
    <VictoryChart height={400} width={400} containerComponent={<VictoryVoronoiContainer/>}>
      <VictoryGroup
        color="#c43a31"
        labels={({ datum }) => `x: ${datum.x} y: ${datum.y}`}
        labelComponent={
          <VictoryTooltip style={{ fontSize: 5 }}/>
        }
        data={data}
      >
        <VictoryLine/>
        <VictoryScatter size={({ active }) => active ? 4 : 2}/>
      </VictoryGroup>
    </VictoryChart>
	);
}

export default PlotRoute;
